import React from 'react';
import '../styles/about.css';

export default function About() {
  return (
    <section id="about" className="about-section">
      <div className="about-container">
        <h2>About Me</h2>
        <p>
          I am a passionate developer with experience in building modern web applications. I enjoy solving problems, learning new technologies, and collaborating with others to create impactful solutions.
        </p>
      </div>
    </section>
  );
}
